import { Container, Form, Navbar } from "react-bootstrap";

function NavBar() {
  return (
    <Navbar expand="lg" className="bk">
      <Container>
        <Navbar.Brand href="#">
          <img src="logo.jpg" className="logo" alt="logo" />
        </Navbar.Brand>
        <Form className="d nav-style" >
       <div>
        
       </div>
        </Form>
      </Container>
    </Navbar>
  );
}

export default NavBar;
